import axios from "axios";

const Header = () => {
  const url =
    "https://api.privatbank.ua/p24api/pubinfo?json&exchange&coursid=5";

  const getValues = async () => {
    axios.get(url).then(function (response) {
      return response;
    });
  };
  getValues();
  return <div>123</div>;
};

export default Header;
